import React, { Component } from "react";

// Externals
import PropTypes from "prop-types";
import classNames from "classnames";

// Material helpers
import { withStyles } from "@material-ui/styles";

// Material components
import { Button, IconButton, Grid } from "@material-ui/core";

// Material icons
import {
	ArrowDownward as ArrowDownwardIcon,
	ArrowUpward as ArrowUpwardIcon,
	Delete as DeleteIcon
} from "@material-ui/icons";

// Component styles
import styles from "./styles";

class ProjectToolbar extends Component {
	render() {
		const { classes, className, selectedUsers } = this.props;

		const rootClassName = classNames(classes.root, className);

		return (
			<div className={rootClassName}>
				<Grid container justify="flex-end">
					<Button
						className={classes.btnToolbar}
						size="small"
						variant="outlined">
						Create Review Event
					</Button>
					<Button
						className={classes.btnToolbar}
						size="small"
						variant="outlined">
						Create Project Group
					</Button>
					<Button
						className={classes.btnToolbar}
						color="primary"
						size="small"
						variant="outlined">
						Add Milestone
					</Button>
				</Grid>
			</div>
		);
	}
}

ProjectToolbar.propTypes = {
	className: PropTypes.string,
	classes: PropTypes.object.isRequired,
	selectedUsers: PropTypes.array
};

ProjectToolbar.defaultProps = {
	selectedUsers: []
};

export default withStyles(styles)(ProjectToolbar);
